import React  from 'react';

export default function Item()
{
 return(
     <div classname="items">
		 <li className="item">
			 lol
			 <button className="botonCompletar"> 
				 <i className="boton"></i>
			 </button>
			 <button className="botonEliminar">
				 <i className="boton2"></i>
			 </button>
		 </li>
	 </div>
 )
}
